import styled from 'styled-components';

export const HeaderArea = styled.div `

.footer {
    color: #fff;
    background-color: #4B4453;
    height:200px;
    margin-top:100px;
    display:flex;
    justify-content: space-around;
    align-items: center;

}

.footer--left-contato{

}

.footer--right form{
    display: flex;
    flex-direction: column;
    justify-content: space-around;

}

.footer--right form input, textarea, label{
    margin: 5px;
}

`
